        <span class="omdoc-titleword">Theorem</span>
        <p> Extensional Example E6ext from Chris Benzmueller's thesis. POWERSET(O(OA)(OA)) NULLSET = UNITSET NULLSET</p>

                <m:mrow>
                  <m:mo>POWERSET</m:mo>
                  <!-- Face using unicode: <char unicode="X2218"/>. -->

                </m:mrow>
                <m:mo>=</m:mo>
                <m:mrow>

                  <!-- Face using unicode: <script>U</script>. -->

                  <m:mo>NULLSET</m:mo>
